VALUES ('3456770946371', 'Soja', 'jus de soja : 76% (eau, graines de soja 6,6%), sucre: 10 %, citron:9,5%, amidon de mais, jus de citron, zestes de citron, phosphates de calcium, amidons modifiés de maïs et de tapioca, arôme naturel, arôme naturel de citron avec autres arômes naturels, arôme naturel de citron vert avec autres arômes naturels épaississants: pectines, gomme guar, sel, ferments. Peut contenir des fruits à coque. PT Especialidade fermentada à base de soja, açucarada, com limão e aromatizada, fonte de cálcio. Ingredientes: bebida de soja: 76 % (água, graos de soja 6,6%), açúcar: 10%, limăo:9,5%, amido de milho, sumo de limão, cascas de limão, fosfatos de cálcio, amidos modificados de milho e de tapioca, aroma natural, aroma naturale di limão com outros aromas naturais, aroma naturale di limão verde com outros aromas naturais, espessantes: pectinas, goma de guar ; sal, fermentoS selecionados. Pode conter vestigios de frutos de casca rija. ES Especialidad fermentada a base de soja, azucarada, con limón y aromatizada, fuente de calcio. Ingredientes: bebida de soja: 76% (agua, granos de soja 6,6%), azúcar: 10%, limón: 9,5%, almidón de maíz, zumo de limón, cortezas de limón, fosfatos de calcio, almidones modificados de maíz y de tapioca, aroma natural, aroma natural de limón con otros aromas naturales, aroma natural de limón verde con otros aromas naturales, espesantes: pectinas, goma guar; sal, fermentos seleccionados. Puede contener trazas de frutos de cáscara. IT Specialita fermentata alla soia, zuccherata, con limone e aromatizzata, fonte di calcio. Ingredienti: succo de soia: 76% (acqua, semi di soia 6,6%), zucchero: 10%, limone: 9,5%, amido di mais, succo di limone, scorze di limone, fosfati di calcio, amidi modificati di mais e di tapioca, aroma naturale, aroma naturale di limone con altri aromi naturali, aroma naturale di limone verde con altri aromi naturali, addensanti : pectine, gomma di quar ; sale, fermenti selezionati. Può contenere tracce di frutta a guscio. 400ge (4x100g)', 'https://static.openfoodfacts.org/images/products/345/677/094/6371/front_fr.4.400.jpg', '1.7', '0.3', '12', '11', '1.9', '3.1', '0.16', '0.062992125984252', '', '1');

